        var t5Base = componentsManager_.GetBufferSlow<T5>();
        if (t5Base.Sparse) typeMask |= 1 << 5;
        switch (typeMask)
        {
            case 0b000000:
                Loop000000(loopAction,
                  (ComponentBufferDense<T0>)t0Base,
                  (ComponentBufferDense<T1>)t1Base,
                  (ComponentBufferDense<T2>)t2Base,
                  (ComponentBufferDense<T3>)t3Base,
                  (ComponentBufferDense<T4>)t4Base,
                  (ComponentBufferDense<T5>)t5Base
                ); return;
            case 0b000001:
                Loop000001(loopAction,
                  (ComponentBufferSparse<T0>)t0Base,
                  (ComponentBufferDense<T1>)t1Base,
                  (ComponentBufferDense<T2>)t2Base,
                  (ComponentBufferDense<T3>)t3Base,
                  (ComponentBufferDense<T4>)t4Base,
                  (ComponentBufferDense<T5>)t5Base
                ); return;
            case 0b000010:
                Loop000010(loopAction,
                  (ComponentBufferDense<T0>)t0Base,
                  (ComponentBufferSparse<T1>)t1Base,
                  (ComponentBufferDense<T2>)t2Base,
                  (ComponentBufferDense<T3>)t3Base,
                  (ComponentBufferDense<T4>)t4Base,
                  (ComponentBufferDense<T5>)t5Base
                ); return;
            case 0b000011:
